import {
  Countdown,
  Navbar,
  Particle,
  Slider,
  Wedding,
  Wishes,
  Gallery,
} from "./components";

const App = () => {
  return (
    <div className="bg-gray-50">
      <Particle />
      <Navbar />
      <Countdown />
      <Slider />
      <Wedding />
      <Wishes />
      <Gallery />
    </div>
  );
};

export default App;
